import React from 'react'
let LeftSideStyles = {
  div: {
    width: '200px',
    height: '700px',
    backgroundColor: '#555555',
    textAlign: 'center',
  },
  span: {
    fontSize: 20,
  },
}
export const LeftSide = () => {
  return (
    <div style={LeftSideStyles.div}>
      <span style={LeftSideStyles.span}>Management Section</span>
      <hr />
      <span style={LeftSideStyles.span}>Create New Post</span>
      <br />
      <span style={LeftSideStyles.span}>See Recent Post</span>
      <br />
      <span style={LeftSideStyles.span}>Profile Setting</span>
    </div>
  )
}
